import React from 'react'
import Card from 'react-bootstrap/Card'

function DescriptionMap() {
    return (
        <div>
           <Card>
            <Card.Body>This is some text within a card body.</Card.Body>
           </Card>
        </div>
    )
}

export default DescriptionMap
